(function(g,$,bootbox){g.ComposerConsole=function(inputUrl){this.url=inputUrl;this.init()};g.ComposerConsole.prototype={init:function(){var composerConsole=this;$.ajax({url:composerConsole.url,type:"GET",success:function(response){composerConsole.content=response.content},error:composerConsole.error})},refresh:function(){this.init()},view:function(){var consoleView=bootbox.dialog({title:"Composer Console Output",message:'<i class="material-icons loader">rotate_right</i>',backdrop:true,onEscape:true,buttons:{ok:{label:"OK",className:"btn-outline-primary"}}});do{}while(this.content===undefined);if(this.content=="")this.content="Console output is empty.";consoleView.find(".modal-body").attr("id","console-output").find(".bootbox-body").html("<pre><code>"+this.content+"</code></pre>")},error:function(xhr){bootbox.alert("Something went wrong please refer to the developer console for more info.");console.log(xhr.responseText)}}})(window,jQuery,bootbox);